export let TenantType;

(function (TenantType) {
  TenantType["CUSTOMER"] = "customer";
  TenantType["SPAM"] = "spam";
  TenantType["TEST"] = "test";
  TenantType["RESELLER"] = "reseller";
  TenantType["HEADQUARTER"] = "headquarter";
})(TenantType || (TenantType = {}));
